import React, { useState, useEffect } from "react"
import TopBar from "../../component/view/appBar";

const Profile = (props) => {
    const [formData, setFormData] = useState({
        user: {
            username: "",
            password: ""
        },
    });

    const handleChange = (e) => {
        setFormData({
            user: {
                ...formData.user,
                [e.target.name]: e.target.value,
            },
        });
    };

    return (
        <>
            {/* <TopBar /> */}
            <figure className="h-screen flex  ">
                <div className=" w-full max-w-md m-auto bg-gray-100 rounded-lg border border-primaryBorder shadow-default py-10 px-1 px-8">

                    <div style={{ marginBottom: "30px" }}>
                        <p>
                            <span className="text-gray-600 font-size: 24px line-height: 28.13px  font-family:roboto font-bold">Nama</span>
                        </p>
                        <strong className="text-black font-size: 18px line-height: 21.09px  font-family:roboto font-bold">Tony Stark</strong>
                    </div>

                    <div>
                        <p>
                            <span className="text-gray-600 font-size: 24px line-height: 28.13px  font-family:roboto font-bold">Alamat</span>
                        </p>
                        <strong className="text-black font-size: 18px line-height: 21.09px  font-family:roboto font-bold">Malybu Mansion</strong>
                    </div>

                    <div>
                        <p>
                            <span className="text-gray-600 font-size: 24px line-height: 28.13px  font-family:roboto font-bold">No. HP</span>
                        </p>
                        <strong className="text-black font-size: 18px line-height: 21.09px  font-family:roboto font-bold">212-970-4133</strong>
                    </div>

                    <div>
                        <p>
                            <span className="text-gray-600 font-size: 24px line-height: 28.13px  font-family:roboto font-bold">Email</span>
                        </p>
                        <strong className="text-black font-size: 18px line-height: 21.09px  font-family:roboto font-bold">@starkenterprises.com</strong>
                    </div>

                    <div>
                        <p>
                            <span className="text-gray-600 font-size: 24px line-height: 28.13px  font-family:roboto font-bold">Motto</span>
                        </p>
                        <strong className="text-black font-size: 18px line-height: 21.09px  font-family:roboto font-bold">The best thing about a boolean is even if you are wrong, you are only off by a bit.</strong>
                    </div>
                </div>
            </figure>
        </>
    );
}
export default Profile
